import { getCategories } from "./categories"
import AsyncStorage from "@react-native-async-storage/async-storage";

const defaultCategories = [
    "Hombros",
    "Triceps",
    "Biceps",
    "Pectoral",
    "Espalda",
    "Piernas",
    "Abdominales"
];

const defaultExercisesCategories = {
    Hombros: [
        "Press Arnold con mancuernas",
        "Press de barra trasnuca",
        "Facepull en polea",
        "Press de hombro frontal"
    ],
    Triceps: [],
    Biceps: [],
    Pectoral: [],
    Espalda: [],
    Piernas: [],
    Abdominales: []
};

const loadInitialData = () => {
    getCategories().then(data => {
        if(!data.length){
            AsyncStorage.setItem("categories", JSON.stringify(defaultCategories));
        }
    });
    AsyncStorage.getItem("exercises-categories").then(data => {
        if(!data){
            AsyncStorage.setItem("exercises-categories", JSON.stringify(defaultExercisesCategories));
        }
    });
}

export default loadInitialData;
